//import './css/Presentacion.css';
import { Button } from 'bootstrap';

function Funcionalidades(){
    return(
        <div class="container py-5">
            <h2 class="section-title">¿Por qué elegir <span class="highlight-text">Innoventa</span>?</h2>
            <p class="subheading">Empieza a Gestionar con las Mejores Herramientas</p>
            <ul class="features-list">
                <li>Gestión de Usuarios y Roles</li>
                <li class="highlight-item">Control de Inventarios en Tiempo Real</li>
                <li>Gestión de Ventas y Pagos</li>
                <li>Reportes y Análisis</li>
                <li>Membresía Premium para Funciones Avanzadas</li>
            </ul>
        </div>
    )
}

export default Funcionalidades;
